import axios from "axios";
import { useState, useEffect } from "react";
function Weather() {
  const [data, setData] = useState();
  const url =
    "https://api.open-meteo.com/v1/forecast?latitude=52.52&longitude=13.41&hourly=temperature_2m,precipitation,weathercode&daily=weathercode,temperature_2m_max&timezone=Europe%2FBerlin";
  useEffect(() => {
    axios.get(url).then(response => setData(response.data));
  }, []);
  return <p>{data}</p>;
}

export default Weather;
